body {
  font-family: ITC Serif Gothic;

  background-color: black !important;
  /* background image */
  background-image: url(https://static.boredpanda.com/blog/wp-content/uploads/2019/11/baby-yoda-the-mandalorian-star-wars-3-5dd13dc8162be__700.jpg);
  /* Create the parallax scrolling effect */
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  /* hide overflow */
  overflow: hidden;
}

.bg-mik {
  background-color: rgba(0, 0, 0, 0.1) !important;
  -webkit-backdrop-filter: blur(5px) !important;
  backdrop-filter: blur(5px) !important  ;
}

.nav-link {
  font-weight: bold;
  color: rgba(255, 255, 0, 0.7) !important;
}

.navbar-nav.navbar-center {
  position: absolute;
  left: 50%;
  transform: translatex(-50%);
}

.star-wars {
  display: flex;
  justify-content: center;
  position: relative;
  height: 800px;
  color: #feda4a;
  font-family: "Pathway Gothic One", sans-serif;
  font-size: 500%;
  font-weight: 600;
  line-height: 150%;
  perspective: 400px;
  text-align: justify;
}

.crawl {
  position: relative;
  top: 0px;
  transform-origin: 50% 100%;
  animation: crawl 100s linear infinite;
}

.crawl > .title {
  font-size: 90%;
  text-align: center;
}

.crawl > .title h1 {
  margin: 0 0 100px;
  text-transform: uppercase;
}

@keyframes crawl {
  0% {
    top: 0;
    transform: rotateX(20deg) translateZ(0);
  }
  100% {
    top: -5000px;
    transform: rotateX(25deg) translateZ(-2500px);
  }
}

.thicc {
  font-size: 12vw;
  line-height: 12vw;
}
img {
  object-fit: cover;
  display: block;
  margin-left: auto;
  margin-right: auto;
  max-width: 100%;
  height: auto;
}
.slim-thicc {
  object-fit: cover;
  display: block;
  margin-left: auto;
  margin-right: 10px;
  max-width: 1000%;
  height: auto;
}

.timer {
  font-weight: bold;
  color: rgba(255, 255, 0, 1) !important;
}

button {
  color: black !important;
}

@media only screen and (max-width: 600px) {
  audio {
    padding-bottom: 2em;
  }
  .thicc {
    font-size: 6vw;
    font-weight: 200px;
    line-height: 7vw;
  }
}

@media only screen and (max-width: 1164px) {
  .desktop-only {
    display: none !important;
  }
}

@media only screen and (min-width: 600px) {
  audio {
    border-radius: 23px;
    width: 50vw;
  }
}

    <script>function changeWallpaper() {
  images = [
    "https://wallpapercave.com/wp/wp4976541.jpg",
    "https://wallpapercave.com/wp/wp4959346.jpg",
    "https://wallpapercave.com/wp/wp4959348.jpg",

    "https://wallpapercave.com/wp/wp4976542.jpg",
    "https://wallpapercave.com/wp/wp4976547.jpg",
    "https://wallpapercave.com/wp/wp4976550.jpg",
    "https://wallpapercave.com/wp/wp4976551.jpg"
  ];
  document.getElementsByTagName("body")[0].style.backgroundImage = `url(${
    images[Math.floor(Math.random() * images.length)]
  })`;
}

function timer() {
  time = Number(document.getElementsByClassName("time")[0].innerHTML);
  Object.values(document.getElementsByClassName("time")).forEach(
    i => (i.innerHTML = time + 1)
  );
  setTimeout(timer, 1000);
}

</script>
